import axios from 'axios';
import { Event } from '../types/event';

const BASE_URL = 'https://staging-api.coing.co/api/v2/communities/838/groups';

export async function fetchEvents(page: number, pageSize = 10) {
  const params = {
    page,
    pageSize,
    'filterBy[closed]': 0,
    'filterBy[isPrivate]': 0,
  };
  const { data } = await axios.get<{ items: Event[] }>(BASE_URL, { params });
  return data;
}
